import React from "react";
import { Header, Carousel } from "../components/mollecules";
import { Button, Cards, Text } from "../components/atomes";
import { Discover } from "../components/organismes";

const produitVinRouge = require("../assets/produitVinRouge.png");

function Home() {
  return (
    <div>
      <Header.laptopHeader />
      <Carousel.Carousel />
      <Discover.Discover />
      <div className="">
        <div className="flex flex-row items-center">
          <div>
            <Text.h4>Nouveautés</Text.h4>
          </div>
          <div className="w-full h-[2px] bg-gray-300 px"></div>
        </div>
        <Cards.Produit
          bg={produitVinRouge}
          color={"#5C221E"}
          typeColor={"#5C221E"}
          type={"Rouge"}
          name={"Vin Rouge Corvo"}
          pays={"Italie"}
          oldPrice={"16.80€"}
          price={"13.80€"}
        />
      </div>
    </div>
  );
}

export default Home;
